schema:
{
 "properties": {
  "spec": {
   "description": "The specification of the StrimziPodSet.",
   "properties": {
    "pods": {
     "description": "The Pods managed by this StrimziPodSet.",
     "items": {
      "format": "textarea",
      "type": "string"
     },
     "type": "array"
    },
    "selector": {
     "description": "Selector is a label query which matches all the pods managed by this `StrimziPodSet`. Only `matchLabels` is supported. If `matchExpressions` is set, it will be ignored.",
     "properties": {
      "matchExpressions": {
       "items": {
        "properties": {
         "key": {
          "type": "string"
         },
         "operator": {
          "type": "string"
         },
         "values": {
          "items": {
           "type": "string"
          },
          "type": "array"
         }
        },
        "type": "object"
       },
       "type": "array"
      },
      "matchLabels": {
       "format": "textarea",
       "type": "string"
      }
     },
     "type": "object"
    }
   },
   "required": [
    "selector",
    "pods"
   ],
   "type": "object"
  }
 },
 "title": "Strimzi Pod Set",
 "type": "object"
}
